@costco recently introduced chocolate ice cream 🍫🍦 to their food court menu, but that ALSO means the strawberry sundae 🍓 gets a little upgrade too! This Strawberry Sundae with Chocolate Ice Cream tastes similar to chocolate covered strawberries and I am here for it 👏

Plus, ordering at the Costco food court never fails to make my jaw drop whenever I see the receipt 😱 I seriously can’t get over their inexpensive prices. The sundae costs $2.49 for a huge amount of ice cream swirled with strawberry topping 😉 

